import React from 'react';
import { Title, HeaderTitle, TextContainer } from './style/componentsStyle'
import GlobalStyle from './style/global'
import Img from 'react-image'

function App() {
  return (
    <div className = "App">
      <GlobalStyle />
      <HeaderTitle>
        <Title>Leonardo da Vinci</Title>
      </HeaderTitle>

      <TextContainer>
        <img src = {require('./Images/Leonardo.jpg')} />
      </TextContainer>
    </div>
  );
}

export default App;
